const Got = (props) => {
    const [characters, setCharacters] = useState([]);
    function getGot() {
        axios.get("https://anapioficeandfire.com/api/characters/")
        .then(response => {
            console.log(response)
            setCharacters(response.data.message)
        })
        .catch(err => console.log(err))
    }


    return (
        <div>
            <Navbar />
            <h1>Winter is coming</h1>
            <button type='submit' onClick={getGot}>Search GOT!</button>
            {pokemon.map((el, i) =>
